private static boolean matchingExitNode(Node n, int type, String labelName) {
    if (n.getType() == type) {
      if (type == Token.RETURN) {
        return !n.hasChildren();
      } else {
        if (labelName == null) {
          return !n.hasChildren();
        } else {
          return n.hasChildren()
            && labelName.equals(n.getFirstChild().getString());
        }
      }
    }
    return false;
  }

